import React from "react";
import JsonData from "./data.json";
import { useState } from "react";
const ShowExams = () => {
  

  fetch("https://localhost:8443/onlineexam/control/examMasterListEvent", {
    method: "GET",
    mode: "no-cors",
  })
    .then(response => {

        console.log(response);
       return  response.json();
    })
    .then(data=>{
        console.log(data)
        data.map((info) => {
            return (
              <tr>
                <td>{info.examId}</td>
                 <td>{info.name}</td>
                <td>{info.city}</td>
                <td>{info.id}</td>
                <td>{info.name}</td>
                <td>{info.city}</td>
                <td>{info.id}</td>
                <td>{info.name}</td>
                <td>{info.city}</td>
                <td>{info.id}</td>
                <td>{info.name}</td>
                <td>{info.city}</td> 
                <td>
                  <button className="btn btn-primary">Update</button>
                </td>
                <td>
                  <button className="btn btn-danger">Delete</button>
                </td>
              </tr>
            );
          });
    })
    .catch((err) => console.log(err));

   ;

  return (
    <div className="row">
      {/* <div className="col-10">
        <table class="table table-striped">
          <thead>
            <tr>
              <th>ExamId</th>
              <th>ExamName</th>
              <th>Description</th>
              <th>CreationDate</th>
              <th>ExpirationDate</th>
              <th>No of Questions</th>
              <th>Duration Minutes</th>
              <th>Pass Percentage</th>
              <th>Questions Randomized</th>
              <th>Answers Must</th>
              <th>Enable negative Mark</th>
              <th>Negative Mark value</th>
            </tr>
          </thead>
          <tbody>{datas}</tbody>
        </table>
      </div> */}
    </div>
  );
};

export default ShowExams;
